import { useSelector } from "react-redux"

const Home = () => {

  const products = useSelector(state => state.products)

  return (
    <div className="container">
      <div className="row gap-3 justify-content-center align-items-top">
        {products && products.map(product => (
          <div className="col-2 d-flex flex-column border rounded" key={product.id}>
            <img src={product.image} alt="product image" className=""  />
            <div>{product.title}</div>
            <div>{product.price}$ <button className="btn btn-sm btn-outline-primary">Add to cart</button> </div>
          </div>
        ))}
      </div>
    </div>
  )
}

export default Home
